                        <p></p>
                        <center>
                            <i style="font-size:14px;">
                                小切手の写真、コピー：Crypto Bankを1週間しか使っていなかった後に功が初めて受け取った90万円の小切手！
                            </i>
                        </center>

                        <p>
                            <b>
                                功がこう言い続けました。
                            </b>
                        </p>

                        <p>
                            <i>
                                「トレードし続け、
